import Carousel from "react-bootstrap/Carousel";

import React from 'react';
function Slider() {
  
 
  return (
    <Carousel variant="dark">
      <Carousel.Item interval={1000}>
        <img className="d-block w-100" src={"https://resources.pulse.icc-cricket.com/photo-resources/2022/07/01/d3c7dcd0-9b3d-441e-a66e-ec37baddbe5a/GettyImages-1348518130-1-.png?width=860&height=420"} alt="First slide" />
        <Carousel.Caption></Carousel.Caption>
      </Carousel.Item>
      <Carousel.Item interval={500}>
        <img className="d-block w-100" src={"https://assets-in.bmscdn.com/promotions/cms/creatives/1701414691882_isl10hyderabadfc1240x300.jpg"} alt="Second slide" />
        <Carousel.Caption></Carousel.Caption>
      </Carousel.Item>
      <Carousel.Item>
        <img className="d-block w-100" src={"https://assets-in.bmscdn.com/promotions/cms/creatives/1702536165956_kingweb.jpg"} alt="Third slide" />
        <Carousel.Caption></Carousel.Caption>
      </Carousel.Item>
    </Carousel>
  );
}

export default Slider;
